import React, { Component } from 'react';
import Cell from './Cell';
import './Board.css';

class Board extends Component {
  constructor(props){
      super(props);
      this.createGrid = this.createGrid.bind(this)
  }
      createGrid() {
          let grid = [];
          for (let i = 0; i < 9; i++){
              grid[i] = [];
              for (let j = 0; j < 9; j++){
                  grid[i][j] = 0;
              }
          }
          return grid
      }
  render() {
    return (
        <div className="board">
            <Cell /> 
            <button className="reset-button">Reset</button>    
        </div>
    );
  }
}

export default Board;
